        // Function to find all paths between two nodes in the knowledge graph
        function findAllPaths(startNode, endNode) {
            const paths = [];
            const visited = new Set();
            const queue = [[startNode, []]];

            while (queue.length > 0) {
                const [currentNode, path] = queue.shift();

                if (currentNode === endNode) {
                    paths.push([...path, currentNode]);
                    continue;
                }

                if (!visited.has(currentNode)) {
                    visited.add(currentNode);
                    const neighbors = knowledgeGraph.filter(triple => triple.subject === currentNode).map(triple => triple.object);
                    for (const neighbor of neighbors) {
                        queue.push([neighbor, [...path, currentNode]]);
                    }
                }
            }

            return paths;
        }

        // Function to find and visualize path between two nodes
        function findPath() {
            const inputNodes = document.getElementById("inputNodes").value.split(",").map(node => node.trim());
            const startNode = inputNodes[0];
            const endNode = inputNodes[1];

            const paths = findAllPaths(startNode, endNode);

            if (paths.length === 0) {
                document.getElementById("result").innerText = `No path found between ${startNode} and ${endNode}`;
                return;
            }

            document.getElementById("result").innerText = `Total paths found: ${paths.length}\nShortest path length: ${paths[0].length - 1}`;

            const svg = d3.select("svg");
            svg.selectAll("*").remove();

            const simulation = d3.forceSimulation()
                .force("link", d3.forceLink().id(d => d.id))
                .force("charge", d3.forceManyBody())
                .force("center", d3.forceCenter(400, 200))
                .force("collision", d3.forceCollide().radius(20));

            const graph = {
                nodes: [],
                links: []
            };

            for (let i = 0; i < paths.length; i++) {
                for (let j = 0; j < paths[i].length - 1; j++) {
                    const source = paths[i][j];
                    const target = paths[i][j + 1];
                    const predicate = knowledgeGraph.find(triple => triple.subject === source && triple.object === target)?.predicate;
                    if (!graph.nodes.find(node => node.id === source)) {
                        graph.nodes.push({ id: source });
                    }
                    if (!graph.nodes.find(node => node.id === target)) {
                        graph.nodes.push({ id: target });
                    }
                    graph.links.push({ source, target, predicate });
                }
            }

            const link = svg.append("g")
                .attr("class", "links")
                .selectAll("line")
                .data(graph.links)
                .enter().append("line")
                .attr("class", "link");

            const arrow = svg.append("defs").selectAll("marker")
                .data(["arrow"])
                .enter().append("marker")
                .attr("id", "arrow")
                .attr("viewBox", "0 -5 10 10")
                .attr("refX", 9)
                .attr("refY", 0)
                .attr("markerWidth", 6)
                .attr("markerHeight", 6)
                .attr("orient", "auto")
                .append("path")
                .attr("class", "arrow")
                .attr("d", "M0,-5L10,0L0,5");

            const predicateText = svg.append("g")
                .attr("class", "predicates")
                .selectAll("text")
                .data(graph.links)
                .enter().append("text")
                .text(d => d.predicate)
                .attr("class", "predicate");

            const node = svg.append("g")
                .attr("class", "nodes")
                .selectAll("g")
                .data(graph.nodes)
                .enter().append("g")
                .call(d3.drag()
                    .on("start", dragstarted)
                    .on("drag", dragged)
                    .on("end", dragended));

            const circles = node.append("circle")
                .attr("r", 5)
                .attr("fill", "skyblue");


            const labels = node.append("text")
                .text(d => d.id)
                .attr("x", 6)
                .attr("y", 3);
            simulation.nodes(graph.nodes).on("tick", () => {
                const padding = 10; // Set padding value to prevent overlapping
                const linkedByIndex = {};
                graph.links.forEach(d => {
                    linkedByIndex[`${d.source.index},${d.target.index}`] = 1;
                });

                node.attr("transform", d => {
                    d.x = Math.max(padding, Math.min(800 - padding, d.x));
                    d.y = Math.max(padding, Math.min(400 - padding, d.y));
                    return `translate(${d.x},${d.y})`;
                });

                link.attr("x1", d => d.source.x)
                    .attr("y1", d => d.source.y)
                    .attr("x2", d => d.target.x)
                    .attr("y2", d => d.target.y);

                predicateText
                    .attr("x", d => (d.source.x + d.target.x) / 2)
                    .attr("y", d => (d.source.y + d.target.y) / 2);

                // Update label positions to prevent overlap
                node.selectAll(".node-label")
                    .attr("x", d => d.x)
                    .attr("y", d => d.y);
            });

            simulation.force("link").links(graph.links);

            function dragstarted(event, d) {
                if (!event.active) simulation.alphaTarget(0.3).restart();
                d.fx = d.x;
                d.fy = d.y;
            }

            function dragged(event, d) {
                d.fx = event.x;
                d.fy = event.y;
            }

            function dragended(event, d) {
                if (!event.active) simulation.alphaTarget(0);
                d.fx = null;
                d.fy = null;
            }

            // Store the paths data for exporting
            window.pathsData = paths.map(path => {
                const triples = [];
                for (let i = 0; i < path.length - 1; i++) {
                    const source = path[i];
                    const target = path[i + 1];
                    const predicate = knowledgeGraph.find(triple => triple.subject === source && triple.object === target)?.predicate;
                    triples.push({ subject: source, predicate: predicate, object: target });
                }
                return triples;
            });
        }

        // Function to export visualization result to Excel
        function exportToExcel() {
            if (!window.pathsData) {
                alert("No paths found. Please run 'Find Path' first.");
                return;
            }
            const data = [];
            data.push(["Subject", "Predicate", "Object"]);
            window.pathsData.forEach(triples => {
                triples.forEach(triple => {
                    data.push([triple.subject, triple.predicate, triple.object]);
                });
            });
            const ws = XLSX.utils.aoa_to_sheet(data);
            const wb = XLSX.utils.book_new();
            XLSX.utils.book_append_sheet(wb, ws, "Visualization Triples");
            XLSX.writeFile(wb, "visualization_triples.xlsx");
        }
    </script>
